import Fetch from "isomorphic-unfetch";

export default function LoadBook(props) {
  props.data.map(data => {
    return <div>{data}</div>;
  });
}

LoadBook.getInitialProps = async function() {
  const res = await fetch("http://www.gutenberg.org/files/2600/2600-0.txt");

  const data = await res;

  return { data };
};

